const people = [
    {
        name: "Ahmed",
        image: "data:image/jpeg;base64,",
        profession: "Web Developer"
    },
    {
        name: "Zahid",
        image: "data:image/jpeg;base64,",
        profession: "Graphic Designer"
    },
    {
        name: "Ali",
        image: "data:image/jpeg;base64,",
        profession: "Data Analyst"
    },
    {
        name: "Naveed",
        image: "data:image/jpeg;base64,",
        profession: "Project Manager"
    }
];
let index = 0

function display(){

    document.querySelector("#image").src = people[index].image
    document.querySelector("#heading").textContent = people[index].name
    document.querySelector(".paragraph").textContent = people[index].profession
}

function next(){
    index = [index + 1] % people.length
    display(index)
}

function preview(){
    index = [index - 1 + people.length] % people.length
    display(index)
}

display(index)
